%% 神经网络的初始配置过程

numLayers = 7;
numNeurons = 20;

layers = [
    featureInputLayer(2, 'Name', 'input')  
    fullyConnectedLayer(numNeurons, 'Name', 'fc_1')
    TanahLayer(numNeurons, 'tanah_1')       
];

for i = 2:numLayers-1
    layers = [
        layers
        fullyConnectedLayer(numNeurons, 'Name', ['fc_', num2str(i)])
        TanahLayer(numNeurons, ['tanah_', num2str(i)])
    ];
end

layers = [
    layers
    fullyConnectedLayer(1, 'Name', 'output')  % 输出格式 [1, batch]
];

net = dlnetwork(layers)
%%
solverState = lbfgsState;

X = dlarray(dataX,"BC");               
Y = dlarray(dataY,"BC");

x0BC1 = dlarray(x0BC1,"CB");
y0BC1 = dlarray(y0BC1,"CB");
BC1 = dlarray(BC1,"CB");
BC1y = dlarray(BC1y,"CB");

x0BC2 = dlarray(x0BC2,"CB");
y0BC2 = dlarray(y0BC2,"CB");
BC2 = dlarray(BC2,"CB");
BC2y = dlarray(BC2y,"CB");

x0BC3 = dlarray(x0BC3,"CB");
y0BC3 = dlarray(y0BC3,"CB");
BC3 = dlarray(BC3,"CB");
BC3n = dlarray(BC3n,"CB");

x0BC4 = dlarray(x0BC4,"CB");
y0BC4 = dlarray(y0BC4,"CB");
BC4 = dlarray(BC4,"CB");

x0BC5 = dlarray(x0BC5,"CB");
y0BC5 = dlarray(y0BC5,"CB");
BC5 = dlarray(BC5,"CB");

lossFcn = @(net) dlfeval(@modelLoss,net,X,Y,x0BC1,y0BC1,BC1,BC1y,x0BC2,y0BC2,BC2,BC2y,x0BC3,y0BC3,BC3,BC3n,x0BC4,y0BC4,BC4,x0BC5,y0BC5,BC5);

%% 

I=[];
loss=[];

for i=1:10000

    [net, solverState] = lbfgsupdate(net,lossFcn,solverState);

    I(i)=i;
    loss(i)=solverState.Loss;

    fprintf('epoch：%d',i);
    fprintf('   loss：%d\n',loss(i));

    if i > 10
        loss_change = abs(loss(i) - loss(i-10));
        if loss_change == 0
            break;
        end
    end
    i=i+1;
end

save('bipinn.mat',"net")

figure(1)
semilogy(I,loss,'r',LineWidth=1)
set(gca,'Fontname','Times New Roman','fontsize',12,'FontWeight','bold')
